import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container:{
        backgroundColor: '#000',
        padding: 20,
        paddingStart: 10
    },
    texto:{
        fontSize:30,
        fontStyle: 'italic',
        fontWeight: 'bold',
        color: '#fff',
        alignItems: 'center',
        textAlign:'center'
    }

});

export default styles;
